contract Migrations {
    address public owner;
    uint public last_completed_migration;

    modifier restricted() {
        if (msg.sender == owner) _;
    }

    constructor() {
        owner = msg.sender;
    }

    function setCompleted(uint completed) public restricted {
        last_completed_migration = completed;
    }

    function upgrade(address new_address) public restricted {
        Migrations upgraded = Migrations(new_address);
        upgraded.setCompleted(last_completed_migration);
    }
}


contract NeonSender {

    event MultiTransfer(
        address indexed _from,
        uint indexed _value,
        address _to,
        uint _amount
    );

    event MultiERC20Transfer(
        address indexed _from,
        uint indexed _value,
        address _to,
        uint _amount,
        ERC20 _token
    );

    constructor()  {}

    function InnerCoinTransfer(address payable[] memory _addresses, uint[] memory _amounts)
    payable public returns(bool)
    {
        uint toReturn = msg.value;
        for (uint i = 0; i < _addresses.length; i++) {
            _safeCoinTransfer(_addresses[i], _amounts[i]);
            toReturn = SafeMath.sub(toReturn, _amounts[i]);
            emit MultiTransfer(msg.sender, msg.value, _addresses[i], _amounts[i]);
        }
        _safeCoinTransfer(payable(msg.sender), toReturn);
        return true;
    }

    function OtherTokensTransfer(
        ERC20 _token,
        address[] memory _addresses,
        uint[] memory _amounts
    ) public payable {
        for (uint i = 0; i < _addresses.length; i++) {
            _safeTokensTransfer(_token, _addresses[i], _amounts[i]);
            emit MultiERC20Transfer(
                msg.sender,
                msg.value,
                _addresses[i],
                _amounts[i],
                _token
            );
        }
    }

    function _safeCoinTransfer(address payable _to, uint _amount) internal {
        require(_to != address(0));
        _to.transfer(_amount);
    }

    function _safeTokensTransfer(ERC20 _token, address _to, uint _amount) internal {
        require(_to != address(0));
        require(_token.transferFrom(msg.sender, _to, _amount));
    }

    receive() external payable {
        revert();
    }
}
